import { withRouter } from 'react-router-dom';

import React, { Component }  from 'react';
import ReactDOM from 'react-dom';
import Slider from './Slider';

function Home(props)
{

    const images = [
        'https://storage.googleapis.com/production-websitebuilder-v1-0-3/823/214823/XIuoGeyR/97dd5fc32e324b94ae982e5163d02407',
        'https://www.atlanticcouncil.org/wp-content/uploads/2019/07/201907390_IsraelBeachPollution_Full.jpg',
        'https://www.bayerjovens.com.br/html/images/fique-ligado/reciclar-ou-reutilizar-1.png',
        'https://previews.123rf.com/images/imagesourceprem/imagesourceprem1706/imagesourceprem170689093/82296042-group-of-people-with-recycling-in-bins.jpg'
      ]

      return (
        <Slider slides={images} />
      )

}

export default withRouter(Home);
